// Mock data for suggestions and filtered results
const suggestions = ['Apple', 'Banana', 'Cherry', 'Durian', 'Elderberry'];
const filteredResults = {
    'Apple': ['Apple result 1', 'Apple result 2', 'Apple result 3'],
    'Banana': ['Banana result 1', 'Banana result 2'],
    'Cherry': ['Cherry result 1'],
    'Durian': ['Durian result 1', 'Durian result 2'],
    'Elderberry': ['Elderberry result 1', 'Elderberry result 2']
};

const searchInput = document.getElementById('search-input');
const suggestionsList = document.getElementById('suggestions-list');
const filteredResultsContainer = document.getElementById('filtered-results');

// Function to display suggestions
function showSuggestions() {
    const query = searchInput.value.toLowerCase();
    suggestionsList.innerHTML = '';

    const filteredSuggestions = suggestions.filter(item => item.toLowerCase().startsWith(query));

    filteredSuggestions.forEach(item => {
        const li = document.createElement('li');
        li.textContent = item;
        suggestionsList.appendChild(li);
    });

    suggestionsList.style.display = filteredSuggestions.length > 0 ? 'block' : 'none';
}

// Function to display filtered results
function showFilteredResults(selectedItem) {
    const results = filteredResults[selectedItem];
    filteredResultsContainer.innerHTML = '';

    if (results) {
        results.forEach(item => {
            const p = document.createElement('p');
            p.textContent = item;
            filteredResultsContainer.appendChild(p);
        });
    } else {
        const p = document.createElement('p');
        p.textContent = 'No results found.';
        filteredResultsContainer.appendChild(p);
    }
}

// Event listeners
searchInput.addEventListener('input', showSuggestions);

suggestionsList.addEventListener('click', (e) => {
    const selectedItem = e.target.textContent;
    searchInput.value = selectedItem;
    suggestionsList.style.display = 'none';
    showFilteredResults(selectedItem);
});

searchInput.addEventListener('blur', () => {
    setTimeout(() => {
        suggestionsList.style.display = 'none';
    }, 200);
});
